package com.test.model.vo;

public class TEst {
	private String test;
	private int toast;
	
	public TEst() {
		super();
		// TODO Auto-generated constructor stub
	}
	
	
	public TEst(String test, int toast) {
		super();
		this.test = test;
		this.toast = toast;
	}
	public String getTest() {
		return test;
	}
	public void setTest(String test) {
		this.test = test;
	}
	public int getToast() {
		return toast;
	}
	public void setToast(int toast) {
		this.toast = toast;
	}
	
	
	
}
